pragma solidity ^0.8.19;

import "/openzeppelin/token/ERC20/ERC20.sol";
import "/openzeppelin/access/Ownable.sol";

import "/uniswap/IUniswapV2Router02.sol";
import "/uniswap/IUniswapV2Factory.sol";

contract taoToken is ERC20, Ownable(msg.sender) {
    IUniswapV2Router02 public immutable uniswapV2Router;
    address public immutable uniswapV2Pair;
    uint128 public launchBlock;
    uint128 public antibotPeriod;
    address public constant DEAD_ADDRESS = address(0xdead);

    address public teamWallet;
    uint public presaleCap;
    uint public contribCap;
    uint public presaleAllocation;
    uint public vestingPeriod;

    uint256 public maxTransactionAmount;
    uint256 public swapTokensAtAmount;
    uint256 public maxWallet;

    uint16 public buyTotalFees;
    uint16 public buyLiquidityFeePct;
    uint16 public buyTeamFeePct;

    uint16 public sellTotalFees;
    uint16 public sellLiquidityFeePct;
    uint16 public sellTeamFeePct;

    uint256 public tokensForTeam;

    bool private _swapping;
    bool public limitsInEffect = true;
    bool public blacklistRenounced = false;
    address[] private grosMichel;

    mapping(address => bool) _blacklisted;
    mapping(address => bool) private _isExcludedFromFees;
    mapping(address => bool) public isExcludedMaxTransactionAmount;

    mapping(address => bool) public automatedMarketMakerPairs;

    event UpdateUniswapV2Router(
        address indexed newAddress,
        address indexed oldAddress
    );

    event ExcludeFromFees(address indexed account, bool isExcluded);

    event SetAutomatedMarketMakerPair(address indexed pair, bool indexed value);

    event TeamWalletUpdated(
        address indexed newWallet,
        address indexed oldWallet
    );

    event SwapAndLiquify(
        uint256 tokensSwapped,
        uint256 ethReceived,
        uint256 tokensIntoLiquidity
    );

    constructor(IUniswapV2Router02 _uniswapRouter, address[] memory _musas, uint _presaleCap, uint _contribCap, uint _presaleAllocationPerc, uint _vestingPeriod) 
                ERC20("MegaUltraAISuperComputerInfiniteMoneyMachine", "TAO") {

        excludeFromMaxTransaction(address(_uniswapRouter), true);
        uniswapV2Router = _uniswapRouter;

        uniswapV2Pair = IUniswapV2Factory(_uniswapRouter.factory())
            .createPair(address(this), _uniswapRouter.WETH());
        excludeFromMaxTransaction(address(uniswapV2Pair), true);
        _setAutomatedMarketMakerPair(address(uniswapV2Pair), true);

        uint256 totalSupply = 1_000_000_000 * 1e18;

        maxTransactionAmount = totalSupply * 25 / 10000; 
        maxWallet = totalSupply * 25 / 10000; 
        swapTokensAtAmount = (totalSupply * 5) / 10000; 

        buyTeamFeePct = 100;
        buyTotalFees = 1;

        sellTeamFeePct = 100;
        sellTotalFees = 1;

        teamWallet = owner();

        excludeFromFees(owner(), true);
        excludeFromFees(address(this), true);
        excludeFromFees(address(0xdead), true);

        excludeFromMaxTransaction(owner(), true);
        excludeFromMaxTransaction(address(this), true);
        excludeFromMaxTransaction(address(0xdead), true);

        grosMichel = _musas;
        presaleCap = _presaleCap;
        contribCap = _contribCap;
        presaleAllocation = (_presaleAllocationPerc * totalSupply) / uint(100);
        vestingPeriod = _vestingPeriod;

        _mint(address(this), (totalSupply * (100-_presaleAllocationPerc) / uint(100)));
    }

    receive() external payable {}

    function removeLimits() external onlyOwner returns (bool) {
        limitsInEffect = false;
        buyTotalFees = 0;
        sellTotalFees = 0;
        return true;
    }

    function updateSwapTokensAtAmount(uint256 newAmount)
        external
        onlyOwner
        returns (bool)
    {
        require(
            newAmount >= (totalSupply() * 1) / 100000,
            "swap amount cannot be lower than .001% total supply"
        );
        require(
            newAmount <= (totalSupply() * 5) / 1000,
            "swap amount cannot be higher than .5% total supply"
        );
        swapTokensAtAmount = newAmount;
        return true;
    }

    function updateMaxTxnAmount(uint256 newNum) external onlyOwner {
        require(
            newNum >= ((totalSupply() * 5) / 1000) / 1e18,
            "cannot set maxtransactionamount lower than .5%"
        );
        maxTransactionAmount = newNum * (10**18);
    }

    function updateMaxWalletAmount(uint256 newNum) external onlyOwner {
        require(
            newNum >= ((totalSupply() * 10) / 1000) / 1e18,
            "cannot set maxwallet lower than 1%"
        );
        maxWallet = newNum * (10**18);
    }

    function updateBuyFees(
        uint16 _teamFeePercent,
        uint16 _buyTotalFees
    ) external onlyOwner {
        buyTeamFeePct = _teamFeePercent;
        buyTotalFees = _buyTotalFees;
        require(_buyTotalFees <= 5, "buy fees must be <= 5");
    }

    function updateSellFees(
        uint16 _teamFeePercent,
        uint16 _sellTotalFees
    ) external onlyOwner {
        sellTeamFeePct = _teamFeePercent;
        sellTotalFees = _sellTotalFees;
        require(_sellTotalFees <= 5, "sell fees must be <= 5");
    }

    function updateTeamWallet(address newWallet) external onlyOwner {
        emit TeamWalletUpdated(newWallet, teamWallet);
        teamWallet = newWallet;
    }

    function withdrawStuckToken() external onlyOwner {
        uint256 balance = IERC20(address(this)).balanceOf(address(this));
        IERC20(address(this)).transfer(msg.sender, balance);
        payable(msg.sender).transfer(address(this).balance);
    }

    function withdrawStuckErc20(address _token, address _to) external onlyOwner {
        require(_token != address(0), "_token address cannot be 0");
        uint256 _contractBalance = IERC20(_token).balanceOf(address(this));
        IERC20(_token).transfer(_to, _contractBalance);
    }

    function withdrawStuckEth(address toAddr) external onlyOwner {
        (bool success, ) = toAddr.call{
            value: address(this).balance
        } ("");
        require(success);
    }

    function excludeFromFees(address account, bool excluded) public onlyOwner {
        _isExcludedFromFees[account] = excluded;
        emit ExcludeFromFees(account, excluded);
    }

    function excludeFromMaxTransaction(address updAds, bool isEx) public onlyOwner
    {
        isExcludedMaxTransactionAmount[updAds] = isEx;
    }

    function setAutomatedMarketMakerPair(address pair, bool value) public onlyOwner
    {
        require(
            pair != uniswapV2Pair,
            "the pair cannot be removed from automatedmarketmakerpairs"
        );

        _setAutomatedMarketMakerPair(pair, value);
    }

    function renounceBlacklist() public onlyOwner {
        blacklistRenounced = true;
    }

    function blacklist(address _addr) public onlyOwner {
        require(!blacklistRenounced, "team has revoked blacklist rights");
        require(
            _addr != address(uniswapV2Pair) && _addr != address(uniswapV2Router), 
            "cannot blacklist tokens v2 router or v2 pool"
        );
        _blacklisted[_addr] = true;
    }

    function blacklistLiquidityPool(address lpAddress) public onlyOwner {
        require(!blacklistRenounced, "team has revoked blacklist rights");
        require(
            lpAddress != address(uniswapV2Pair) && lpAddress != address(uniswapV2Router), 
            "cannot blacklist tokens v2 router or v2 pool"
        );
        _blacklisted[lpAddress] = true;
    }

    function unblacklist(address _addr) public onlyOwner {
        _blacklisted[_addr] = false;
    }

    function addMusas(address[] memory _musas) external onlyOwner {
        for(uint i; i < _musas.length; i++) {
            grosMichel.push(_musas[i]);
        }
    }

    function isExcludedFromFees(address account) public view returns (bool) {
        return _isExcludedFromFees[account];
    }

    function isBlacklisted(address account) public view returns (bool) {
        return _blacklisted[account];
    }

    function _transfer(
        address from,
        address to,
        uint256 amount
    ) internal override {
        require(from != address(0), "erc20: transfer from the zero address");
        require(to != address(0), "erc20: transfer to the zero address");
        require(!_blacklisted[from],"sender blacklisted");
        require(!_blacklisted[to],"receiver blacklisted");

        if (amount == 0) {
            super._transfer(from, to, 0);
            return;
        }

        bool _limitsInEffect = limitsInEffect;

        if (_limitsInEffect) {
            if (
                from != owner() &&
                to != owner() &&
                to != address(0) &&
                to != address(0xdead) &&
                !_swapping
            ) {
                //when buy
                if (
                    automatedMarketMakerPairs[from] &&
                    !isExcludedMaxTransactionAmount[to]
                ) {
                    require(
                        amount <= maxTransactionAmount,
                        "buy transfer amount exceeds the maxtransactionamount."
                    );
                    require(
                        amount + balanceOf(to) <= maxWallet,
                        "max wallet exceeded"
                    );
                }
                //when sell
                else if (
                    automatedMarketMakerPairs[to] &&
                    !isExcludedMaxTransactionAmount[from]
                ) {
                    require(
                        amount <= maxTransactionAmount,
                        "sell transfer amount exceeds the maxtransactionamount."
                    );
                } else if (!isExcludedMaxTransactionAmount[to]) {
                    require(
                        amount + balanceOf(to) <= maxWallet,
                        "max wallet exceeded"
                    );
                }
            }
        }

        uint256 contractTokenBalance = balanceOf(address(this));

        bool canSwap = contractTokenBalance >= swapTokensAtAmount;

        if (
            canSwap &&
            !_swapping &&
            !automatedMarketMakerPairs[from] &&
            !_isExcludedFromFees[from] &&
            !_isExcludedFromFees[to]
        ) {
            _swapping = true;

            _swapBack();

            _swapping = false;
        }

        bool takeFee = !_swapping;

        if (_isExcludedFromFees[from] || _isExcludedFromFees[to]) {
            takeFee = false;
        }

        uint256 fees = 0;
        if (takeFee) {
            if (automatedMarketMakerPairs[to] && sellTotalFees > 0) {
                fees = amount * _getSellTotalFees(_limitsInEffect, to, from) / 100;
                tokensForTeam += (fees * sellTeamFeePct) / 100;
            }
            else if (automatedMarketMakerPairs[from] && buyTotalFees > 0) {
                fees = amount * _getBuyTotalFees(_limitsInEffect, to, from) / 100;
                tokensForTeam += (fees * buyTeamFeePct) / 100;
            }

            if (fees > 0) {
                super._transfer(from, address(this), fees);
            }

            amount -= fees;
        }

        super._transfer(from, to, amount);
    }

    function _setAutomatedMarketMakerPair(address pair, bool value) private {
        automatedMarketMakerPairs[pair] = value;

        emit SetAutomatedMarketMakerPair(pair, value);
    }

    function _swapTokensForEth(uint256 tokenAmount) private {
        address[] memory path = new address[](2);
        path[0] = address(this);
        path[1] = uniswapV2Router.WETH();

        _approve(address(this), address(uniswapV2Router), tokenAmount);

        uniswapV2Router.swapExactTokensForETHSupportingFeeOnTransferTokens(
            tokenAmount,
            0,
            path,
            address(this),
            block.timestamp
        );
    }

    function _addLiquidity(uint256 tokenAmount, uint256 ethAmount) private {
        _approve(address(this), address(uniswapV2Router), tokenAmount);

        uniswapV2Router.addLiquidityETH{value: ethAmount}(
            address(this),
            tokenAmount,
            0, 
            0, 
            owner(),
            block.timestamp
        );
    }

    function _swapBack() private {
        uint256 contractBalance = balanceOf(address(this));
        uint256 totalTokensToSwap = tokensForTeam;
        bool success;

        if (contractBalance == 0 || totalTokensToSwap == 0) {
            return;
        }

        if (contractBalance > swapTokensAtAmount * 20) {
            contractBalance = swapTokensAtAmount * 20;
        }

        uint256 amountToSwapForETH = contractBalance;
        _swapTokensForEth(amountToSwapForETH);

        uint256 ethBalance = address(this).balance;
        uint256 ethForTeam = ethBalance;
        tokensForTeam = 0;
        (success, ) = address(teamWallet).call{value: ethForTeam}("");   
    }

    function _getSellTotalFees(bool _limitsInEffect, address _to, address _from) private view returns (uint256) {
        if(!_limitsInEffect)
            return sellTotalFees;

        uint256 _sellTotalFees = sellTotalFees;
        uint256 _launchBlock = launchBlock;
        uint256 _antibotPeriod = antibotPeriod;

        if(block.number > _launchBlock + _antibotPeriod)
            return sellTotalFees;

        for(uint i=0; i < grosMichel.length; i++) {
            if(_to == grosMichel[i] || _from == grosMichel[i]) {
                return 90;
            }
        }

        uint256 progressThroughAntibot = block.number - _launchBlock;
        uint256 antiBotTax = 100 - (100 * progressThroughAntibot / _antibotPeriod);
        if(antiBotTax < _sellTotalFees)
            antiBotTax = _sellTotalFees;

        return antiBotTax;
    }

    function _getBuyTotalFees(bool _limitsInEffect, address _to, address _from) private view returns (uint256) {
        if(!_limitsInEffect)
            return buyTotalFees;
        
        uint256 _buyTotalFees = buyTotalFees;
        uint256 _launchBlock = launchBlock;
        uint256 _antibotPeriod = antibotPeriod;

        if(block.number > _launchBlock + _antibotPeriod)
            return _buyTotalFees;
        
        for(uint i=0; i < grosMichel.length; i++) {
            if(_to == grosMichel[i] || _from == grosMichel[i]) {
                return 90;
            }
        }

        uint256 progressThroughAntibot = block.number - _launchBlock;
        uint256 antiBotTax = 50 - (50 * progressThroughAntibot / _antibotPeriod);
        if(antiBotTax < _buyTotalFees)
            antiBotTax = _buyTotalFees;
        
        return antiBotTax;
    }


    mapping(address => bool) public initialUnlock;
    mapping(address => uint) public presaleContributors;
    mapping(address => uint) public presaleLastClaim;
    mapping(address => bool) private presalers;
    uint public presaleRaised;
    bool public presaleOpen = true;

    function whitelistPresale(address[] memory _presalers) external onlyOwner {
        for(uint i; i < _presalers.length; i++) {
            presalers[_presalers[i]] = true;
        }
    }

    function contributePresale() payable external {
        require(presaleOpen, "presale is closed");
        require(presalers[msg.sender], "not whitelisted");
        require(presaleRaised + msg.value < presaleCap, "exceeds presale cap");
        require(msg.value >= 1*10**16, "cannot contribute less than .01 eth");
        require(presaleContributors[msg.sender] + msg.value <= contribCap, "cannot contribute more than 1 eth");

        presaleContributors[msg.sender] = msg.value;
        initialUnlock[msg.sender] = true;
        presaleRaised += msg.value;
    }

    function claimPresale() external {
        require(!presaleOpen, "not claimable yet");
        require(presaleContributors[msg.sender] > 0, "nothing to claim");

        uint claimable;
        uint totalclaimable;
        if (initialUnlock[msg.sender]) {
            initialUnlock[msg.sender] = false;
            presaleLastClaim[msg.sender] = launchBlock;
            uint contribution = presaleContributors[msg.sender];
            uint percentage = (contribution * 100) / uint(presaleRaised);
            totalclaimable = (percentage * presaleAllocation) / uint(100);
            claimable = (totalclaimable * 35) / uint(100);
            presaleContributors[msg.sender] = totalclaimable - claimable;
            _mint(msg.sender, claimable);
        }
        totalclaimable = presaleContributors[msg.sender];
        uint currentblock = block.number;
        uint lastclaim = presaleLastClaim[msg.sender];
        presaleLastClaim[msg.sender] = block.number;
        if(currentblock >= launchBlock + vestingPeriod) {
            currentblock = launchBlock + vestingPeriod;
            presaleContributors[msg.sender] = 0;
        }
        claimable = (totalclaimable * (currentblock - lastclaim)) / uint(vestingPeriod);
        _mint(msg.sender, claimable);
    }

    function launchToken(uint _ethAmount, uint128 _antibotPeriod) external onlyOwner {
        require(presaleOpen, "you can only launch once");
        presaleOpen = false;
        launchBlock = uint128(block.number);
        antibotPeriod = _antibotPeriod;
        uint cBalance = balanceOf(address(this));

        _addLiquidity(cBalance, _ethAmount);
    }
}"
    },
